import ReactDOM from 'react-dom';

import './index.css';
import App from './App';
import AddNew from './components/AddNew';

ReactDOM.render(<App />, document.getElementById('root'));


document.getElementById("AddNew").addEventListener("click", function(event){
    console.log("Clicked");
    document.getElementsByClassName("expense-item")[document.getElementsByClassName("expense-item").length - 1].parentNode.insertBefore(<AddNew></AddNew>, document.getElementsByClassName("expense-item")[document.getElementsByClassName("expense-item").length - 1].nextSibling);
})
if (module.hot) {
    module.hot.accept();
  }
